    <div className='top-up-container'>
          <div className='icon-container'> <FaTelegram style={{ marginRight: '8px',  }} /></div> Top up</div>
     <div className='pay-container'>
          <div className='icon-container'> <FaTelegram style={{ marginRight: '8px',  }} /></div>Pay</div>
           <div className='transfer-container'>
          <div className='icon-container'> <FaTelegram style={{ marginRight: '8px',  }} /></div>Transfer money</div>
      </div>
    );
  }
  
  export default QuickActions;
